  tibble(metric = "log10(daily mean mel EDI)",
         data = metrics %>% filter(metric == "mean") %>% pull(data)) %>% 
  mutate(formula_H1 = c(formula_H2_interaction),
         formula_H0 = c(formula_H0_interaction),
         type = "lmer"
         )

inference_H2.2 <-
  inference_H2.2 %>%
